// for now if you want to test any component you created test from this file

import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import HeaderAppBar from './components/HeaderAppBar';
import { AuthContextProvider } from './components/contexts/AuthContext';
import Recommender from './components/recommendator/Recommender';
import SavedStockCard from './components/saved_stocks/SavedStockCard';
import SavedStocksTableView from './components/saved_stocks/SavedStocksTableView';
import { Switch } from '@mui/material';
import Home from './components/home/Home';


function App() {
  return (
    <BrowserRouter>
        <AuthContextProvider>
        <div className="App">
          <div className='header'>
            <HeaderAppBar/>
          </div>

          <Routes>
            <Route 
            path='/'
            Component={Home} />
            <Route 
            path='/recommender' 
            exact
            Component={Recommender} />
            <Route 
            path='/your-stocks' 
            exact
            Component={SavedStocksTableView} />

          </Routes>


            {/* <SavedStocksTableView url={'http://localhost:8080/sdavis92/stocks'}/> */}


        </div>
      </AuthContextProvider>
    </BrowserRouter>


  );
}

export default App;
